import React from "react";
import  ReactDOM  from "react-dom";
import logo from './logo.svg'

function Navbar() {
  return (
    <> 
    <img src = {logo} className = "Navbar" />
    <h1>React Facts</h1>
    <h2>React Course-Project 1</h2>
    </>
    )

}


const Element = <>
  <Navbar/>

</>





const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(Element);
